import React from 'react';

class Item extends React.Component {

	render() {
		return (
		<p>login page</p>
		);
	}

	setActiveDragItem(e) {
		ItemsList.activeItem = this.props.uuid;
	}

	dragOver(e) {
		e.stopPropagation();
		e.preventDefault();
	}

	onDrop(e) {
		this.props.swapItems(ItemsList.activeItem,this.props.uuid);
		ItemsList.activeItem = null;
	}
}

export default Login;
